import { CommonModule } from '@angular/common';

@Component({
  selector: 'app-housing-locations',
  standalone: true,
  imports: [CommonModule],
  template: `
    <p>
      housing-locations works!
    </p>
  `,
  styleUrls: ['./housing-locations.component.css']
})
export class HousingLocationsComponent {

}
